import React from "react";
import "../styles/Projects.css";

function Projects() {
    return(
        <div className="projects text-center">
            <h1>My Projects</h1>
            <p className="fw-bold">Some projects I have worked on in the past, and a current one I am working on.</p>
        </div>
    );
}

export default Projects;
